import React from 'react';

function Test() {
  return (
    <div
      style={{
        backgroundColor: 'red',
        color: 'white',
        padding: '50px',
        fontSize: '30px',
        textAlign: 'center',
        margin: '20px',
      }}
    >
      <h1>TEST FILE IS WORKING!</h1>
      <p>If you see this red box, React is reading files correctly.</p>
    </div>
  );
}

export default Test;
